		me._map3of3.ggRadar.update=function() {
			var radar=me._map3of3.ggRadar;
			var d2r = Math.PI/180 ;
			var fov = player.getFov();
			var pan = player.getPanNorth();
			pan -= me._map3of3.ggFloorplanNorth;
			var filterpassed = true;
			var currentId = player.getCurrentNode();
			if (me._map3of3.ggFilteredIds.length > 0 && me._map3of3.ggFilteredIds.indexOf(currentId) == -1) filterpassed = false;
			if ((me._map3of3.ggSimpleFloorplanMarkerArray.hasOwnProperty(currentId)) && filterpassed) {
				var activeMarker = me._map3of3.ggSimpleFloorplanMarkerArray[currentId];
				if ((radar.radarElement) && (fov==radar.lastFov) && (pan==radar.lastPan) && (activeMarker.radarXPos==radar.xPos) && (activeMarker.radarYPos==radar.yPos)) return; 
				radar.lastPan=pan; radar.lastFov=fov;
				radar.xPos=activeMarker.radarXPos; radar.yPos=activeMarker.radarYPos;
				if (radar.radarElement) me._map3of3__mapdiv.removeChild(radar.radarElement);
				radar.radarElement = document.createElementNS('http://www.w3.org/2000/svg','svg');
				radar.radarElement.setAttributeNS(null,'width',100);
				radar.radarElement.setAttributeNS(null,'height',100);
				radar.radarElement.setAttributeNS(null,'viewBox','0 0 100 100');
				var radarPath = document.createElementNS('http://www.w3.org/2000/svg','path');
				radarPath.setAttributeNS(null,'id','radarPath');
				pan = -90 - pan;
				var arcX1 = 50 * Math.cos((pan - fov / 2) * d2r);
				var arcY1 = 50 * Math.sin((pan - fov / 2) * d2r);
				var arcX2 = 50 * Math.cos((pan + fov / 2) * d2r);
				var arcY2 = 50 * Math.sin((pan + fov / 2) * d2r);
				arcX1 += 50;
				arcY1 += 50;
				arcX2 += 50;
				arcY2 += 50;
				var radarPathString = 'M50,50 L' + arcX1 + ',' + arcY1 + ' A 50 50 0 0 1 ' + arcX2 + ' ' + arcY2 +' Z';
				radarPath.setAttributeNS(null,'d', radarPathString);
				radarPath.setAttributeNS(null,'fill', '#ff0000');
				radarPath.setAttributeNS(null,'fill-opacity', 0.35);
				radarPath.setAttributeNS(null,'stroke', '#ff0000');
				radarPath.setAttributeNS(null,'stroke-opacity', 0.8);
				radarPath.setAttributeNS(null,'stroke-width', 1);
				radarPath.setAttributeNS(null,'stroke-linejoin', 'miter');
				radar.radarElement.appendChild(radarPath);
				me._map3of3__mapdiv.appendChild(radar.radarElement);
				var radarXPos = activeMarker.radarXPos - 50;
				var radarYPos = activeMarker.radarYPos - 50;
				radar.radarElement.style['position'] = 'absolute';
				radar.radarElement.style['left'] = '' + radarXPos + 'px';
				radar.radarElement.style['top'] = '' + radarYPos + 'px';
				radar.radarElement.style['z-index'] = me._map3of3.style['z-index'] + 1;
			} else {
				if (radar.radarElement) {
					me._map3of3__mapdiv.removeChild(radar.radarElement);
					radar.radarElement = null;
				}
			}
		}
